import { useEffect } from 'react';

import Header from '../components/Header';
import Theme from '../components/home/Theme';

// import r1 from "../assets/main-el1.png";
// import r2 from "../assets/main-el2.png";

import MenuList from '../components/home/MenuList';
import { HomePageContent } from '../store/content/HomePageContent';

const HomePage = () => {
  

  return (
    <div className='w-full h-screen relative overflow-hidden'>
      <div className='bg-blue-100 h-full'>
        <Header data={HomePageContent} />
        <Theme data={HomePageContent} />

        <MenuList />

        <img
          className='absolute top-[31%] left-[71%] -z-0'
          width={250}
          src={r1}
        />
        <img
          className='absolute top-20 right-1/2 -z-0'
          width={350}
          src={r2}
        />
        <img
          className='absolute top-16 right-[82%] -z-0'
          width={200}
          src={r2}
        />
        <img
          className='absolute top-[27rem] left-[55%] -z-0'
          width={300}
          src={r2}
        />

        <div className='absolute bottom-0 left-[71%] font-semibold text-white m-2'>
          <p className='mb-3'>
            <span className='border-b-4 border-blue-700 inline-block mb-2'>
              {HomePageContent.fgosNum}
            </span>
            <br />
            {HomePageContent.fgos}
          </p>
          <p>
            <span className='border-b-4 border-blue-700 inline-block mb-2'>
              {HomePageContent.mdkNum}
            </span>
            <br />
            {HomePageContent.mdk}
          </p>
        </div>
      </div>
    </div>
  );
};

export default HomePage;

const r1 =
  'data:image/png;base64,';
const r2 =
  'data:image/png;base64,';
